  //pages
  // Login (landing page - sign in/create profile)
    // Home (home feed)
    //Profile (view profile)
    //Matches
  return (
    <Router>
      <Routes>
        <Route path="/" element={<Login/>}/>
        <Route path="/home" element={<Home/>}/>
        <Route path="/vprofile" element={<Profile/>}/>
      </Routes>
    </Router>
  )
}

export default App;
